import React from "react";
import { View, Text } from "react-native";
import { useState } from "react";

import styl from "./styles"
import customFonts from "../../styles/font"
import Contactinputs from "../../components/Contactinputs"


const Addcontact = () => {

    return (

        <View>
            <View style={styl.searchContainer}>
                <Contactinputs />
                <Text style={customFonts.h1}>Contact</Text>
                {/* Search komes hera!! */}
            </View>
            <View>
                {/* Hear is the main view {list views} */}
                <Text style={customFonts.displayName}>Siggi valur</Text>
            </View>
        </View>
        
    );
}

export default Addcontact;
